export const styles = {
    '*' : {
        maring: 0,
        padding: 0,
    },
    body : {
        width: '100%',
        height: '100%',
    },
    ul : {
        listStyle: 'none'
    },
    li : {
        listStyle: 'none'
    },
    '.header': {
        width: '100vw',
        height: '10vh',
        margin: '5vh'
    }


}
